package com.kuaixiu.recycleUser.entity;import com.common.base.entity.BaseEntity;/** * . * * @CreateDate: 2019-05-30 上午10:24:26 * @version: V 1.0 */public class HsUser extends BaseEntity {        /**     * 序列化Id     */    private static final long serialVersionUID = 1L;    /**     *      */    private String id ;    /**     * 登录手机号     */    private String phone ;    /**     * 名字     */    private String name ;    /**     * 头像url     */    private String imageUrl ;    /**     *      */    private Integer idDel ;    /**     *      */    private java.util.Date createTime ;    /**     *      */    private java.util.Date updateTime ;    public String getId(){        return this.id;    }    public void setId(String id){        this.id=id;    }    public String getPhone(){        return this.phone;    }    public void setPhone(String phone){        this.phone=phone;    }    public String getName(){        return this.name;    }    public void setName(String name){        this.name=name;    }    public String getImageUrl(){        return this.imageUrl;    }    public void setImageUrl(String imageUrl){        this.imageUrl=imageUrl;    }    public Integer getIdDel(){        return this.idDel;    }    public void setIdDel(Integer idDel){        this.idDel=idDel;    }    public java.util.Date getCreateTime(){        return this.createTime;    }    public void setCreateTime(java.util.Date createTime){        this.createTime=createTime;    }    public java.util.Date getUpdateTime(){        return this.updateTime;    }    public void setUpdateTime(java.util.Date updateTime){        this.updateTime=updateTime;    }}